(24,NULL,NULL,'2020-06-21 09:36:14','2020-06-29 04:34:25',1,1,'2020-06-29 04:34:25',NULL,'Link','<p>Hello</p>\n<p class=\"ft01\">ay&nbsp;occur,&nbsp;I hereby&nbsp;attest&nbsp;that,&nbsp;after&nbsp;reading&nbsp;this&nbsp;Form completely&nbsp;and&nbsp;carefully,&nbsp;I acknowledge&nbsp;that&nbsp;my&nbsp;participation&nbsp;in&nbsp;the&nbsp;Activity&nbsp;is&nbsp;entirely&nbsp;</p>\n<p class=\"ft01\">voluntary,&nbsp;and&nbsp;I further&nbsp;understand&nbsp;and&nbsp;agree&nbsp;as&nbsp;follows:&nbsp;</p>\n<p class=\"ft01\">ASSUMPTION OF RISKS:&nbsp;I hereby&nbsp;assume&nbsp;all&nbsp;of&nbsp;the&nbsp;risks&nbsp;of&nbsp;participating&nbsp;in&nbsp;all&nbsp;activities&nbsp;at&nbsp;PMJ Park&nbsp;Holdings,&nbsp;LLC&nbsp;(&ldquo;PMJ&rdquo;)&nbsp;d/b/a&nbsp;Victory&nbsp;Park&nbsp;Ohio&nbsp;</p>\n<p class=\"ft01\">(&ldquo;VPO&rdquo;),&nbsp;located&nbsp;at&nbsp;7777&nbsp;Victory&nbsp;Lane,&nbsp;North&nbsp;Ridgeville,&nbsp;Ohio&nbsp;44039,&nbsp;including&nbsp;but&nbsp;not&nbsp;limited&nbsp;to,&nbsp;any&nbsp;risks&nbsp;that&nbsp;may&nbsp;arise&nbsp;from the&nbsp;negligence&nbsp;or&nbsp;</p>\n<p class=\"ft01\">carelessness of&nbsp;PMJ, VPO, their&nbsp;subsidiaries, affiliates, directors,&nbsp;officers,&nbsp;employees,&nbsp;partners,&nbsp;contractors,&nbsp;agents,&nbsp;representatives,&nbsp;volunteers,&nbsp;</p>\n<p class=\"ft01\">successors&nbsp;and&nbsp;assigns&nbsp;(collectively,&nbsp;the&nbsp;&ldquo;Host&rdquo;)&nbsp;and/or&nbsp;from dangerous&nbsp;or&nbsp;defective&nbsp;equipment&nbsp;or&nbsp;property&nbsp;owned,&nbsp;maintained,&nbsp;&nbsp;operated&nbsp;or&nbsp;</p>\n<p class=\"ft01\">controlled&nbsp;by&nbsp;the&nbsp;Host.&nbsp;</p>\n<p class=\"ft01\">I understand&nbsp;that&nbsp;incidental&nbsp;to&nbsp;my&nbsp;participation&nbsp;in&nbsp;the&nbsp;Activity,&nbsp;I may&nbsp;be&nbsp;engaging&nbsp;in&nbsp;activities&nbsp;that&nbsp;involve&nbsp;the&nbsp;risk&nbsp;of&nbsp;serious&nbsp;personal&nbsp;injury,&nbsp;illness,&nbsp;</p>\n<p class=\"ft01\">permanent&nbsp;disability,&nbsp;dismemberment,&nbsp;and&nbsp;death,&nbsp;and&nbsp;that&nbsp;such&nbsp;participation&nbsp;may&nbsp;also&nbsp;involve&nbsp;the&nbsp;risk&nbsp;of&nbsp;severe&nbsp;economic&nbsp;and&nbsp;property&nbsp;loss&nbsp;and&nbsp;</p>\n<p class=\"ft01\">damage. I understand&nbsp;that&nbsp;these&nbsp;risks&nbsp;may&nbsp;result&nbsp;from the&nbsp;actions,&nbsp;negligence&nbsp;and&nbsp;failure&nbsp;to&nbsp;act&nbsp;of&nbsp;myself&nbsp;and&nbsp;others&nbsp;and&nbsp;from the&nbsp;condition&nbsp;of&nbsp;any&nbsp;</p>\n<p class=\"ft01\">property,&nbsp;facilities&nbsp;or&nbsp;equipment&nbsp;used. I&nbsp;also&nbsp;understand&nbsp;that&nbsp;there&nbsp;may&nbsp;be&nbsp;risks&nbsp;involved&nbsp;which&nbsp;are&nbsp;not&nbsp;known&nbsp;to&nbsp;me&nbsp;or&nbsp;to&nbsp;the&nbsp;Released&nbsp;Parties,&nbsp;and&nbsp;</p>\n<p class=\"ft01\">may&nbsp;not&nbsp;be&nbsp;foreseen&nbsp;or&nbsp;reasonably&nbsp;foreseeable&nbsp;by&nbsp;any&nbsp;of&nbsp;us&nbsp;at&nbsp;this&nbsp;time&nbsp;or&nbsp;at&nbsp;the&nbsp;time&nbsp;of&nbsp;the&nbsp;Activity.&nbsp;Despite knowing these risks,&nbsp;I&nbsp;hereby&nbsp;elect&nbsp;to&nbsp;</p>\n<p class=\"ft01\">voluntarily&nbsp;participate&nbsp;in&nbsp;the&nbsp;Activity&nbsp;and&nbsp;agree to&nbsp;assume all&nbsp;related&nbsp;risks,&nbsp;including&nbsp;without&nbsp;limitation&nbsp;those&nbsp;enumerated&nbsp;above,&nbsp;and&nbsp;accept&nbsp;personal&nbsp;</p>\n<p class=\"ft01\">responsibility&nbsp;for&nbsp;any&nbsp;injury&nbsp;of&nbsp;any&nbsp;kind&nbsp;or&nbsp;nature&nbsp;that&nbsp;I or&nbsp;my&nbsp;property&nbsp;may&nbsp;suffer&nbsp;arising&nbsp;out&nbsp;of&nbsp;or&nbsp;in&nbsp;connection&nbsp;with&nbsp;my&nbsp;participation&nbsp;in&nbsp;the&nbsp;Activity.&nbsp;&nbsp;</p>\n<p class=\"ft01\">PHYSICAL&nbsp;CONDITION/MEDICAL&nbsp;AUTHORIZATION:&nbsp;I hereby&nbsp;certify&nbsp;that&nbsp;I am physically&nbsp;fit&nbsp;for&nbsp;participation&nbsp;in&nbsp;the&nbsp;Event/Activity,&nbsp;have&nbsp;the&nbsp;skill&nbsp;level&nbsp;</p>\n<p class=\"ft01\">required&nbsp;in&nbsp;conjunction&nbsp;with&nbsp;the&nbsp;Activity,&nbsp;and&nbsp;have&nbsp;not&nbsp;been&nbsp;advised&nbsp;otherwise.&nbsp;I&nbsp;agree&nbsp;that&nbsp;before&nbsp;I participate&nbsp;in&nbsp;the&nbsp;Activity, I&nbsp;will&nbsp;inspect&nbsp;all&nbsp;related&nbsp;</p>\n<p class=\"ft01\">facilities&nbsp;and&nbsp;equipment. In&nbsp;connection&nbsp;with&nbsp;any&nbsp;injury&nbsp;sustained&nbsp;or&nbsp;illness&nbsp;or&nbsp;medical&nbsp;conditions&nbsp;experienced&nbsp;during&nbsp;my&nbsp;attendance&nbsp;in&nbsp;connection&nbsp;</p>\n<p class=\"ft01\">with&nbsp;the&nbsp;Activity,&nbsp;I authorize&nbsp;any&nbsp;emergency&nbsp;first&nbsp;aid,&nbsp;medication,&nbsp;medical&nbsp;treatment&nbsp;or&nbsp;surgery&nbsp;deemed&nbsp;necessary&nbsp;by&nbsp;the&nbsp;attending&nbsp;medical&nbsp;personnel&nbsp;</p>\n<p class=\"ft01\">if&nbsp;I am&nbsp;not&nbsp;able&nbsp;to&nbsp;act&nbsp;on&nbsp;my&nbsp;own&nbsp;behalf.&nbsp;Additionally,&nbsp;I authorize&nbsp;medical&nbsp;treatment&nbsp;for&nbsp;me,&nbsp;at&nbsp;my&nbsp;cost,&nbsp;if&nbsp;the&nbsp;need&nbsp;arises;&nbsp;however,&nbsp;I acknowledge&nbsp;</p>\n<p class=\"ft01\">that&nbsp;the Released Parties shall&nbsp;have&nbsp;no&nbsp;duty,&nbsp;obligation&nbsp;or&nbsp;liability&nbsp;arising&nbsp;out&nbsp;of&nbsp;the&nbsp;provision&nbsp;of,&nbsp;or&nbsp;failure&nbsp;to&nbsp;provide,&nbsp;medical&nbsp;treatment.&nbsp;</p>\n<p class=\"ft01\">In&nbsp;consideration&nbsp;for&nbsp;permitting&nbsp;me&nbsp;to&nbsp;engage&nbsp;in&nbsp;or&nbsp;participate&nbsp;in&nbsp;the&nbsp;Activity,&nbsp;I agree&nbsp;for&nbsp;myself,&nbsp;my&nbsp;executors,&nbsp;administrators,&nbsp;heirs,&nbsp;successors,&nbsp;and&nbsp;</p>\n<p class=\"ft01\">assigns as&nbsp;follows:&nbsp;</p>\n<p class=\"ft01\">(A)&nbsp;</p>\n<p class=\"ft01\">I WAIVE,&nbsp;RELEASE,&nbsp;AND&nbsp;DISCHARGE&nbsp;the&nbsp;Host&nbsp;from&nbsp;any&nbsp;and&nbsp;all&nbsp;liability, including&nbsp;but&nbsp;not&nbsp;limited&nbsp;to, liability&nbsp;arising&nbsp;from&nbsp;the&nbsp;negligence&nbsp;of&nbsp;</p>\n<p class=\"ft01\">the Host, for&nbsp;my&nbsp;death, disability,&nbsp;personal&nbsp;injury,&nbsp;property&nbsp;damage,&nbsp;property&nbsp;theft,&nbsp;or&nbsp;any&nbsp;other&nbsp;damage&nbsp;or&nbsp;actions&nbsp;of&nbsp;any&nbsp;kind&nbsp;which&nbsp;may&nbsp;affect&nbsp;or&nbsp;</p>\n<p class=\"ft01\">impact&nbsp;me&nbsp;in&nbsp;any&nbsp;way&nbsp;arising&nbsp;from&nbsp;the&nbsp;Activity.&nbsp;</p>\n<p class=\"ft01\">(B)&nbsp;</p>\n<p class=\"ft01\">I&nbsp;INDEMNIFY,&nbsp;HOLD HARMLESS,&nbsp;AND PROMISE&nbsp;NOT&nbsp;TO SUE&nbsp;the Host&nbsp;from any&nbsp;and&nbsp;all&nbsp;liabilities&nbsp;or&nbsp;claims&nbsp;made&nbsp;as&nbsp;a result&nbsp;of&nbsp;my&nbsp;participation&nbsp;</p>\n<p class=\"ft01\">in&nbsp;the&nbsp;Activity,&nbsp;whether&nbsp;caused&nbsp;by&nbsp;the&nbsp;negligence&nbsp;of&nbsp;the Host&nbsp;or otherwise.&nbsp;</p>\n<p class=\"ft01\">This&nbsp;Accident&nbsp;Waiver&nbsp;and&nbsp;Release&nbsp;of&nbsp;Liability&nbsp;Form&nbsp;(&ldquo;Release&nbsp;Form&rdquo;) shall&nbsp;be&nbsp;construed&nbsp;in&nbsp;accordance&nbsp;with&nbsp;the&nbsp;laws</p>',NULL,NULL,1,1),
